import React, {
  Fragment,
  useState,
  useEffect
} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import Navbar from './components/layout/Navbar';
import Alert from './components/layout/Alert';
import {
  TeamSqoud
} from './components/Pages/TeamSqoud';
import {
  Match
} from './components/Pages/Match';
import {
  CreateMatch
} from './components/Pages/CreateMatch';
import {
  Dashboard
} from './components/Pages/Dashboard';
import './components/css/App.css'
import ShowPlayers from './components/Pages/ShowPlayers';
import {
  LoginPage
} from './components/Pages/LoginPage';
import RegisterUser from './components/Pages/RegisterUser';
import ManagerControl from './components/Pages/Manger/ManagerControl'
import AddUser from './components/Pages/Manger/Account/AddAccountPage'
import RemoveUser from './components/Pages/Manger/Account/RemoveAccountPage'
import UpdateUser from './components/Pages/Manger/ManagerControl'



const App = () => {

    const teamName = ""


    useEffect(() => {
      // Update the document title using the browser API
      const user = JSON.parse(sessionStorage.getItem("loginUser"))
      console.log("UserUpdate")
    });

    return ( <
      Router >
      <
      div className = "App" >
      <
      Navbar teamName = {
        teamName
      }
      /> <
      div className = "container" >
      <
      Switch >
      <
      Route exact path = "/"
      component = {
        LoginPage
      }
      /> <
      Route exact path = "/Manager"
      component = {
        ManagerControl
      }
      /> <
      Route exact path = "/Manager/AddUser"
      component = {
        AddUser
      }
      /> <
      Route exact path = "/Manager/RemoveUser"
      component = {
        RemoveUser
      }
      /> <
      Route exact path = "/Manager/UpdateUser"
      component = {
        ManagerControl
      }
      /> <
      Route exact path = "/Manager/SearchUser"
      component = {
        ManagerControl
      }
      />

      <
      Route exact path = "/TeamSqoud"
      component = {
        TeamSqoud
      }
      /> <
      Route exact path = "/Match"
      component = {
        Match
      }
      /> <
      Route exact path = "/CreateMatch"
      component = {
        () => < CreateMatch nameTeam = {
          teamName
        }
        /> } / >
        <
        Route exact path = "/Dashboard"
        component = {
          Dashboard
        }
        /> <
        Route exact path = "/Test"
        component = {
          CreateMatch
        }
        /> <
        Route exact path = "/ShowPlayers"
        component = {
          ShowPlayers
        }
        /> <
        Route exact path = "/LoginPage"
        component = {
          LoginPage
        }
        /> <
        Route exact path = "/RegisterUser"
        component = {
          RegisterUser
        }
        />



        <
        /Switch> <
        /div> <
        div >
        <
        /div> <
        /div> <
        /Router>
      );
    };

    export default App;
